import React, { useEffect, useState } from "react";
import Footer from "../Footer";
import { Button } from "@mui/material";
import Card from "react-bootstrap/Card";
import Navbar from "../Navbar";
import axios from "axios";

function Porsche() {
  const [car, setcar] = useState([]);

  useEffect(() => {
    const fetch = async () => {
      try {
        const response = await axios.get("http://localhost:4000/car/porsche");
        setcar(response.data);
      } catch (error) {
        console.error("error", error);
      }
    };
    fetch();
  }, []);
  return (
    <div>
      <Navbar />
      <div>
        <img
          style={{ width: "100%", height: "650px" }}
          src="https://wallpapercave.com/wp/wp1861729.jpg"
          alt=""
        />
      </div>
      <div style={{ display: "flex" }}>
        <div style={{ flex: "1", marginLeft: "200px", marginTop: "100px" }}>
          {car.map((obj, ind) => (
            <div key={ind}>
              <Card>
                <Card.Img
                  style={{
                    height: "400px",
                    width: "700px",
                    borderRadius: "15px",
                  }}
                  variant="top"
                  src={`http://localhost:4000/images/${obj.image}`}
                />
                <Card.Body>
                  <div style={{ display: "flex" }}>
                    <div>
                      <Card.Text>
                        <b>{obj.model}</b><br />
                        <b>{obj.cost}</b>
                      </Card.Text>
                    </div>
                    <Button
                      style={{
                        marginLeft: "500px",
                        width: "100px",
                        height: "50px",
                        marginTop: "20px",
                        color: "white",
                        backgroundColor: "black",
                      }}
                    >
                      book
                    </Button>
                  </div>
                </Card.Body>
              </Card>
            </div>
          ))}
        </div>
        <div style={{ marginTop: "120px" }}>
          <Card style={{ width: "18rem", border: "1px solid grey" }}>
            <Card.Body>
              <Card.Title style={{ textAlign: "center" }}>
                <b>For More Information</b>
              </Card.Title>
              <div
                style={{
                  width: "50px",
                  height: "2px",
                  backgroundColor: "black",
                }}
              />
              <Card.Subtitle className="mb-2 text-muted">
                <b>For More Information</b>
              </Card.Subtitle>
              <Card.Text>
                Some quick example text to build on the card title and make up
                the bulk of the card's content.
              </Card.Text>
              <Card.Link href="#">Card Link</Card.Link>
              <Card.Link href="#">Another Link</Card.Link>
            </Card.Body>
          </Card>
        </div>
      </div>

      <Footer />
    </div>
  );
}

export default Porsche;
